/**
 * Applies a callable to each token of a stream.
 * @param {Callable} callable the callable to apply
 * @param {Stream} stream the stream to process
 */
export function map ( callable , stream ) {

	return fromiterable( _map( callable , toiterable( stream ) ) ) ;

}

/**
 * Outputs the next token of a stream that is not contained in a given toskip
 * set.
 * @param {Stream} stream
 * @param {Iterable} toskip
 */
export function skip ( stream , toskip ) {

	const _toskip = new Set( toskip ) ;

	while ( true ) {

		const token = stream.read( ) ;

		if ( token === null ) return null ;

		if ( _toskip.has( token ) ) continue ;

		return token ;

	}

}

/**
 * @kind function
 */
export const skipblanks = stream => skip( stream , ' \t\n' ) ;

import { fromiterable } from '../from' ;

import { exhaust } from '../exhaust' ;

/**
 * Splits the input stream into a stream of streams according to some set of
 * separators. See {@link _split} for the actual implementation.
 *
 * @param {Stream} stream - The input stream.
 * @param {Iterable} sep - An iterable of separators.
 * @returns {Stream}
 */
export function split ( stream , sep ) {

	return fromiterable( _split( stream , sep ) ) ;

}

/**
 * Same as {@link split}, but returns an iterator rather than a stream.
 *
 * @param {Stream} stream - The input stream.
 * @param {Iterable} sep - An iterable of separators.
 * @returns {Iterator}
 */
export function* _split ( stream , sep ) {

	const _sep = new Set( sep ) ;

	while ( true ) {

		const token = stream.read( ) ;

		if ( token === null ) break ;

		if ( _sep.has( token ) ) continue ;

		const group = fromiterable( ( function* ( ) {

			yield token ;

			while ( true ) {

				const token = stream.read( ) ;

				if ( _sep.has( token ) ) break ;

				yield token ;

			}

		} )( ) ) ;

		yield group ;

		exhaust( group ) ;

	}

}

